//adds coordinates to meshVertices, texture coordinates to meshTextCoords,
//and normal components to meshNormals for the given indices(indices starts at 0)

function addTriangleVertexForIndices(vIndex, tIndex, nIndex){
    //add x,y, and z coordinates
    meshVertices.push(vertices[3*vIndex], vertices[3*vIndex+1], vertices[3*vIndex+2]);
    //add s and t texture coordinates
    meshTexCoords.push(textureCoords[3*tIndex],textureCoords[3*tIndex+1]);
    //add x,y and z components of normal
    meshNormals.push(normals[3*nIndex], normals[3*nIndex+1], normals[3*nIndex+2]);
}

// This function goes over the given teapot data and 
// does the necessary index organization tasks.
// The main task is to convert the given polygons (quads and triangles)
// into meshVertices, meshNormals, and meshTextCoords.


function prepareSkates() {
    //QUADS
    for( var i=0; i < quads.length; i+=12 ){
    //first triangle
    addTriangleVertexForIndices(quads[i]-1, quads[i+1]-1,quads[i+2]-1);
    addTriangleVertexForIndices(quads[i+3]-1, quads[i+4]-1,quads[i+5]-1);
    addTriangleVertexForIndices(quads[i+6]-1, quads[i+7]-1,quads[i+8]-1);
    //second triangle
    addTriangleVertexForIndices(quads[i]-1, quads[i+1]-1,quads[i+2]-1);
    addTriangleVertexForIndices(quads[i+6]-1, quads[i+7]-1,quads[i+8]-1);
    addTriangleVertexForIndices(quads[i+9]-1, quads[i+10]-1,quads[i+11]-1);
        
    }

}

function render() {
    

    gl.clear( gl.COLOR_BUFFER_BIT|gl.DEPTH_BUFFER_BIT);
   
    if (control==1){modelViewMatrix = mult(rotateY(5), modelViewMatrix);}
    if (control==2){modelViewMatrix = mult(rotateX(5), modelViewMatrix);}
    if (control==3){modelViewMatrix = mult(rotateZ(5), modelViewMatrix);}
    
     normalMatrix = [
        vec3(modelViewMatrix[0][0], modelViewMatrix[0][1], modelViewMatrix[0][2]),
        vec3(modelViewMatrix[1][0], modelViewMatrix[1][1], modelViewMatrix[1][2]),
        vec3(modelViewMatrix[2][0], modelViewMatrix[2][1], modelViewMatrix[2][2])
    ];
    
    gl.uniformMatrix4fv(modelViewMatrixLoc, false, flatten(modelViewMatrix) );
    gl.uniformMatrix4fv(projectionMatrixLoc, false, flatten(projectionMatrix) );
    gl.uniformMatrix3fv(normalMatrixLoc, false, flatten(normalMatrix) );

    gl.drawArrays( gl.TRIANGLES, 0, (meshVertices.length)/3 );
}